import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import FindJobsComponent from './components/FindJobComponent';
import PostJobsComponent from './components/PostJobsComponent';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/find-jobs" component={FindJobsComponent} />
        <Route exact path="/post-job" component={PostJobsComponent} />
      </Switch>
    </Router>
  );
};

export default App;
